import { useSelector } from "react-redux";
import { login } from "../api/Api";

const isLoggedReducer = async (state = false, action) => {
    switch (action.type) {
        case "SIGN_IN":
            const message = login(action.payload);
            if(message === "user logged in"){
                state = true
                history.pushState
            } else {
                return console.log(message);
            }
        case "SIGN_OUT":
            return state = false
        default:
            return state;
    }
}

export function LoggedSelector(){
    return useSelector(state => state.isLogged);
}

export default isLoggedReducer;
